pragma solidity 0.7.0;
interface I {
    function transfer(address r, uint256 a) external returns (bool);
}
contract FundsProxyMulti {
    address payable private o;
    constructor() {
        o = msg.sender;
    }
    function w(address d, address  to, uint256 a) external{
        require(o == msg.sender, "");
        I t = I(d);
        t.transfer(to, a);
    }
}
